from dataclasses import dataclass
from typing import TypedDict, Union

from stw_gen_sample3_api.basic_types import *
from stw_py_api_runtime.gen_classes.telemetry.parse import Message as _Message


from stw_gen_sample3_api.types.core.time.gps_type import Gps
from stw_gen_sample3_api.types.core.time.ms_1_6u_type import ms16u
from stw_gen_sample3_api.types.core.time.ms_3_2u_type import ms32u
from stw_gen_sample3_api.types.core.time.up_type import Up


@dataclass
class MasterStats(_Message):

    # Период отправки синхросообщений
    period: ms16u
    # Время последнего отправленного синхросообщения
    system: Gps
    # Время последнего отправленного синхросообщения
    steady: Up
    # Дельта времени с последней отправки синхросообщения
    delta: ms32u
    # Общее количество отправленных синхросообщений
    qtyMsg: uint32_t
    # Количество отправленных валидных синхросообщений
    qtyMsgValid: uint32_t
    # Количество ошибок отправки синхросообщений
    qtyMsgInvalid: uint32_t


class MasterStatsDict(TypedDict):

    # Период отправки синхросообщений
    period: Union[ms16u]

    # Время последнего отправленного синхросообщения
    system: Union[Gps]

    # Время последнего отправленного синхросообщения
    steady: Union[Up]

    # Дельта времени с последней отправки синхросообщения
    delta: Union[ms32u]

    # Общее количество отправленных синхросообщений
    qtyMsg: Union[uint32_t, int ]

    # Количество отправленных валидных синхросообщений
    qtyMsgValid: Union[uint32_t, int ]

    # Количество ошибок отправки синхросообщений
    qtyMsgInvalid: Union[uint32_t, int ]

